import React, { Component } from 'react';

export class UserGreeting extends Component {

    constructor(props) {
        super(props)

        this.state = {
            isLoggedin: false
        }
    }



    render() {

        return(

         this.state.isLoggedin ?
         <div>Welcome</div> :
         <div>Please login</div>


        )
    }
}

export default UserGreeting;
